import React from 'react';

const Cart = (props) => {
    console.log(props.cart[0])
    const cart = props.cart.map(item => <div><img src={item.img} alt="Socks"></img><div>{item.name}</div><div>{item.quantity}</div><div>{item.price * item.quantity}</div></div>)

    return (
        <div>
            {cart}
        </div>
    )
}

export default Cart;
